        },
        {
            id: 3,
            titre: "Titre 3",
            article: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptate, quisquam!"
        }



    ])

    return (
         <div>
            { blog.map ((blog, index) => {
                return <div key={index}>
                <h3>{blog.titre}</h3>
                <p>{blog.article}</p>
                </div>
            })}
        </div>
    )
}
